            return (<Entypo name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
        case "Ionicons": {
            const Ionicons = require("react-native-vector-icons/Ionicons").default;
            return (<Ionicons name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
        case "SimpleLineIcons": {
            const SimpleLineIcons = require("react-native-vector-icons/SimpleLineIcons")
