            return (<SimpleLineIcons name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
        case "EvilIcons": {
            const EvilIcons = require("react-native-vector-icons/EvilIcons").default;
            return (<EvilIcons name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
        case "MaterialIcons": {
            const MaterialIcons = require("react-native-vector-icons/MaterialIcons")
                .default;
            return (<MaterialIcons name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
