        }
        case "Foundation": {
            const Foundation = require("react-native-vector-icons/Foundation")
                .default;
            return (<Foundation name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
        case "MaterialCommunityIcons": {
            const MaterialCommunityIcons = require("react-native-vector-icons/MaterialCommunityIcons")
                .default;
            return (<MaterialCommunityIcons name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
        case "Zocial": {
            const Zocial = require("react-native-vector-icons/Zocial").default;
            return (<Zocial name={name} size={size} style={style} color={color} onPress={onPress}/>);
        }
        case "Octicons": {
            const Octicons = require("react-native-vector-icons/Octicons").default;
            return (<Octicons name={name} style={style} color={color} size={size ? size : 18} onPress={onPress}/>);
        }
